import { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import "./Register.css";

export default function Register() {
  const [nume, setNume] = useState("");
  const [email, setEmail] = useState("");
  const [parola, setParola] = useState("");

  const nav = useNavigate();

  async function handleSubmit(e) {
    e.preventDefault();

    const res = await fetch("http://localhost:8000/register", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ nume, email, parola })
    });

    const data = await res.json();

    if (res.ok) {
      nav("/login");
    } else {
      alert(data.detail || "Eroare la server.");
    }
  }

  return (
    <div className="auth-background">
      <div className="auth-card">
        <h1>Crează un cont</h1>
        <p className="subtitle">Completează datele pentru a continua</p>

        <form onSubmit={handleSubmit}>
          <div className="input-group">
            <label>Nume complet</label>
            <input
              className="modern-input"
              value={nume}
              onChange={(e) => setNume(e.target.value)}
              placeholder="Ex: Andrei Popescu"
            />
          </div>

          <div className="input-group">
            <label>Email</label>
            <input
              className="modern-input"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              placeholder="email@example.com"
            />
          </div>

          <div className="input-group">
            <label>Parola</label>
            <input
              type="password"
              className="modern-input"
              value={parola}
              onChange={(e) => setParola(e.target.value)}
              placeholder="********"
            />
          </div>

          <button className="auth-btn">Înregistrare</button>
        </form>

        <p className="redirect-text">
          Ai deja cont? <Link to="/login">Conectează-te</Link>
        </p>
      </div>
    </div>
  );
}
